import React, { Fragment } from "react";
import styled from "styled-components";

const Container = styled.div`
  height: 30%;
  padding: 0 2rem;
  width: 100%;
  box-shadow: #e9e9e9 0px 1px 4px;
  margin: 30px 0;
`;

export const FormDesc = styled.h3`
  margin: 0 46px 8px 2px;
  font-family: PingFangSC;
  font-size: 14px;
  font-weight: normal;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.57;
  letter-spacing: normal;
  color: rgba(0, 0, 0, 0.85);
  white-space: nowrap;
`;

export const Input = styled.input`
  height: 32px;
  padding: 5px 12px;
  border-radius: 4px;
  border: solid 1px rgba(0, 0, 0, 0.15);
  background-color: #ffffff;
  width: ${(props) => props.width};
  margin: ${(props) => props.margin};

  &::-webkit-input-placeholder {
    font-family: HelveticaNeue;
    font-size: 14px;
    font-weight: normal;
    font-stretch: normal;
    font-style: normal;
    line-height: 1.57;
    letter-spacing: normal;
    color: rgba(0, 0, 0, 0.25);
  }
`;

const SecondSearchRow = styled.form`
  display: flex;
  justify-content: space-around;
  align-items: center;
`;

const Select = styled.select`
  width: 190px;
  height: 32px;
  padding: 5px 12px;
  border-radius: 4px;
  border: solid 1px rgba(0, 0, 0, 0.15);
  background-color: #ffffff;
  font-family: HelveticaNeue;
  font-size: 14px;
  font-weight: normal;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.57;
  letter-spacing: normal;
  color: rgba(0, 0, 0, 0.25);
`;

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
`;

const SearchFormFields = [
  {
    type: "text",
    name: "min",
    width: "88px",
    placeholder: "Min",
    label: "Amount",
  },
  {
    type: "text",
    name: "max",
    width: "88px",
    placeholder: "Max",
    label: "",
  },
  {
    type: "text",
    name: "binNumber",
    width: "88px",
    placeholder: "Bin Num",
    label: "BIN Number",
  },
  {
    type: "email",
    name: "email",
    width: "200px",
    placeholder: "Email",
    label: "Email",
  },
];

const Search = () => {
  return (
    <Container>
      <Input
        type="text"
        name="transactionId"
        width="272px"
        //   onChange={(e) => onChange(e)}
        placeholder="Search Trans ID"
        //   value={formData[name]}
        style={{ marginBottom: "1.5rem", marginLeft: "0.8rem" }}
      />
      <SecondSearchRow>
        <Wrapper>
          <FormDesc>Decision</FormDesc>
          <Select>
            <option value="0">first</option>
            <option value="1">second</option>
            <option value="2">third</option>
          </Select>
        </Wrapper>
        <Wrapper>
          <FormDesc>Payment</FormDesc>
          <Select>
            <option value="0">first</option>
            <option value="1">second</option>
            <option value="2">third</option>
          </Select>
        </Wrapper>
        <Wrapper>
          <FormDesc>Amount</FormDesc>
          <div style={{ display: "flex" }}>
            <Input
              type="text"
              name="min"
              width="88px"
              //   onChange={(e) => onChange(e)}
              placeholder="Min"
              //   value={formData[name]}
            />
            <Input
              type="text"
              name="max"
              width="88px"
              //   onChange={(e) => onChange(e)}
              placeholder="Max"
              //   value={formData[name]}
            />
          </div>
        </Wrapper>
        <Wrapper>
          <FormDesc>BIN Number</FormDesc>
            <Input
              type="text"
              name="binNumber"
              width="200px"
              //   onChange={(e) => onChange(e)}
              placeholder="Bin Num"
              //   value={formData[name]}
            />
        </Wrapper>
        <Wrapper>
          <FormDesc>Email</FormDesc>
            <Input
              type="text"
              name="email"
              width="200px"
              //   onChange={(e) => onChange(e)}
              placeholder="Bin Num"
              //   value={formData[name]}
            />
        </Wrapper>
        {/* {SearchFormFields.map((formField, index) => {
          const { type, name, placeholder, label, width,margin } = formField;
          return (
            <Wrapper key={index}>
              <FormDesc>{label}</FormDesc>
              <Input
                type={type}
                name={name}
                width={width}
                margin={margin||0}
                //   onChange={(e) => onChange(e)}
                placeholder={placeholder}
                //   value={formData[name]}
              />
            </Wrapper>
        //   ); */}
        {/* })} */}
        {/* <Button onClick={(e) => onSubmit(e)}>
          Submit
        </Button> */}
      </SecondSearchRow>
    </Container>
  );
};

export default Search;
